                ever
              </p>
            </PostItemText>
          </article>
        </PostItem>
        <PostItem>
          <article>
            <img src="../../images/posts/post6.png" alt="Post 3" />
            <PostItemText>
              <p>
                Lorem Ipsum is simply dummy text of the printing and typesetting
                industry. Lorem Ipsum has been the industrys standard dummy text
                ever
              </p>
            </PostItemText>
          </article>
        </PostItem>
      </PostList>
    </Container>
  );
};

export default Posts;
